('2356','2','8327','Whg. Batres',Null,'1 ½ Schlafzimmer Wohnung mit spektakulärem Panorama Blick','33187','Diese Wohnung liegt in einer kleinen Wohnanlage mit nur 8 Wohnungen in Costa den Blanes. Zu dem Edelhafen Porto Portals sind es nur 3 Fahrminuten. Die Wohnung hat ca 70m² Wohnfläche die sich auf ein Wohn-Esszimmer, Küche, 1 ½ Schlafzimmer und ein Badezimmer verteilt. Ein offener Autoabstellplatz steht zur Verfügung. Zur Ausstattung gehören Klimaanlage w/k, Kamin im Wohnzimmer, Einbauküche, Alu Doppelglasfenster und Möbel. Die Wohnanlage hat keinen Pool. Die monatlichen Gemeinschaftskosten liegen bei 45€.','33188','199000','106','2015-07-31 12:04:29','106','2015-07-31 12:04:47',Null,'2436','86','1145',1,'1','0',Null,Null,Null,'33189',Null,'0','0','0',Null,'2015-07-31 12:09:19',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33190',Null,'33191',Null,'33192',Null,'33193','676323224','33194','0',0,'7');
